import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <div className="container">
        <NavLink className="navbar-brand fw-bold" to="/">
          E-Commerce Website
        </NavLink>

        {/* Toggle Button for Mobile */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Navbar Links */}
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav">
            {/* Home */}
            <li className="nav-item">
              <NavLink
                to="/"
                className={({ isActive }) =>
                  "nav-link" + (isActive ? " active fw-bold text-light" : "")
                }
              >
                Home
              </NavLink>
            </li>

            <li className="nav-item dropdown">
              <NavLink
                to="#"
                className="nav-link dropdown-toggle"
                role="button"
                data-bs-toggle="dropdown"
              >
                View
              </NavLink>
              <ul className="dropdown-menu">
                <li>
                  <NavLink className="dropdown-item" to="/categoryview">
                    View Categories
                  </NavLink>
                </li>
                <li>
                  <NavLink className="dropdown-item" to="/registerview">
                    Registered Users
                  </NavLink>
                </li>
                <li>
                  <NavLink className="dropdown-item" to="/">
                    View Products
                  </NavLink>
                </li>
              </ul>
            </li>

            <li className="nav-item">
              <NavLink
                to="/addcategory"
                className={({ isActive }) =>
                  "nav-link" + (isActive ? " active fw-bold text-light" : "")
                }
              >
                Add Category
              </NavLink>
            </li>

            <li className="nav-item dropdown">
              <NavLink
                to="#"
                className="nav-link dropdown-toggle"
                role="button"
                data-bs-toggle="dropdown"
              >
                Category
              </NavLink>
              <ul className="dropdown-menu">
                <li>
                  <NavLink className="dropdown-item" to="/category">
                    Add Category
                  </NavLink>
                </li>
                <li>
                  <NavLink className="dropdown-item" to="/categoryview">
                    View Categories
                  </NavLink>
                </li>
              </ul>
            </li>

            {/* Manage Dropdown (Category + Product) */}
            <li className="nav-item dropdown">
              <NavLink
                to="#"
                className="nav-link dropdown-toggle"
                role="button"
                data-bs-toggle="dropdown"
              >
                Products
              </NavLink>
              <ul className="dropdown-menu">
                <li>
                  <NavLink className="dropdown-item" to="/addproduct">
                    Add Product
                  </NavLink>
                </li>
                {/* <li>
                  <NavLink className="dropdown-item" to="/">
                    View Products
                  </NavLink>
                </li> */}
              </ul>
            </li>

            {/* Feedback */}
            <li className="nav-item">
              <NavLink
                to="/feedback"
                className={({ isActive }) =>
                  "nav-link" + (isActive ? " active fw-bold text-light" : "")
                }
              >
                Feedback
              </NavLink>
            </li>

            {/* Account Dropdown (Login + Sign Up) */}
            <li className="nav-item dropdown">
              <NavLink
                to="#"
                className="nav-link dropdown-toggle"
                role="button"
                data-bs-toggle="dropdown"
              >
                Account
              </NavLink>
              <ul className="dropdown-menu dropdown-menu-end">
                <li>
                  <NavLink className="dropdown-item" to="/login">
                    Login
                  </NavLink>
                </li>
                <li>
                  <NavLink className="dropdown-item" to="/register">
                    Sign Up
                  </NavLink>
                </li>
                <li>
                  <NavLink className="dropdown-item" to="/registerview">
                    Registered Users
                  </NavLink>
                </li>
              </ul>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
